<?php
require_once __DIR__ . DIRECTORY_SEPARATOR . '..' . DIRECTORY_SEPARATOR . 'resourcetimingDecompression.0.3.4.php';

class ResourcetimingDecompressTest extends \PHPUnit_Framework_TestCase
{

    public function testBasic()
    {
        $testInput = '{
                "http://": {
                    "foo.com/": {
                        "js/foo.js": "370,1z,1c|390,1,2",
                    "css/foo.css": "48c,5k,14"
                }
            }
        }';

        $expected = '[{"name":"http://moc.oof/js/foo.js","initiatorType":"script","startTime":252,"redirectStart":0,"redirectEnd":0,"fetchStart":252,"domainLookupStart":0,"domainLookupEnd":0,"connectStart":0,"secureConnectionStart":0,"connectEnd":0,"requestStart":0,"responseStart":300,"responseEnd":323,"duration":71},{"name":"http://moc.oof/js/foo.js","initiatorType":"script","startTime":324,"redirectStart":0,"redirectEnd":0,"fetchStart":324,"domainLookupStart":0,"domainLookupEnd":0,"connectStart":0,"secureConnectionStart":0,"connectEnd":0,"requestStart":0,"responseStart":326,"responseEnd":325,"duration":1},{"name":"http://moc.oof/css/foo.css","initiatorType":"css","startTime":300,"redirectStart":0,"redirectEnd":0,"fetchStart":300,"domainLookupStart":0,"domainLookupEnd":0,"connectStart":0,"secureConnectionStart":0,"connectEnd":0,"requestStart":0,"responseStart":340,"responseEnd":500,"duration":200}]';

        $resourceTimingDecompression = new ResourceTimingDecompression_v_0_3_4();

        $this->assertEquals(
            json_decode($expected, true),
            $resourceTimingDecompression->decompressResources(json_decode($testInput, true))
        );
    }

